import { SystemProgram } from "@solana/web3.js";
import { createMultisigSetRentCollectorInstruction } from "../generated";
export function multisigSetRentCollector({ multisigPda, configAuthority, newRentCollector, rentPayer, memo, programId, }) {
    return createMultisigSetRentCollectorInstruction({
        multisig: multisigPda,
        configAuthority,
        rentPayer,
        systemProgram: SystemProgram.programId,
    }, {
        args: {
            rentCollector: newRentCollector,
            memo: memo ?? null,
        },
    }, programId);
}
